import React, { Component } from 'react'

export default class output extends Component {
    constructor(props){
        super(props)
    }

    render() {
        return (
            <div id="output">
                <div id="hourOutput">12</div>
                <div id="dotsOutput">:</div>
                <div id="minuteOutput">12</div>
            </div>
        )
    }
}
